import React from 'react';
import { Box, Grid, makeStyles } from '@material-ui/core';
import { Header, ExtraHeaderSection, Services, ProjectCount, Pricing, Testimonial, Newsletter } from './Component/Component';


const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" },
}))

const Main = () => {
    const classes = useStyles();
    return (
        <>
            <main>
                <Box>
                    <Grid container>
                        <Grid item lg={10} md={11} className={classes.margin}>
                            <Header />
                            <ExtraHeaderSection />
                            <Services />
                            <ProjectCount />
                            <Pricing />
                            <Testimonial />
                            <Newsletter />
                        </Grid>
                    </Grid>
                </Box>
            </main>
        </>
    )
}

export default Main;
